import React, {Component} from 'react';
import './App.css';



class App extends Component {
render(){
  return (
    <div className="App">
      <header className="App-header">
      </header>
      <div><button>Name</button></div>
      <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
    </div>
  );
}
};

export default App;
